import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { MunicipioDataService } from './service/municipio.service.js';

export default function BasicDemo() {
    const [municipios, setMunicipios] = useState([]);

    useEffect(() => {
        MunicipioDataService.getAll().then(data => setMunicipios(data));
    }, []);

    return (
        <div className="card">
            <DataTable value={municipios} tableStyle={{ minWidth: '50rem' }}>
                <Column field="id_munic" header="Code"></Column>
                <Column field="nm_munic" header="Name"></Column>
            </DataTable>
        </div>
    );
}
